import "./projects-path.css";
import AppBar from "@mui/material/AppBar";
import Button from "@mui/material/Button";
import CameraIcon from "@mui/icons-material/PhotoCamera";
import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import CssBaseline from "@mui/material/CssBaseline";
import Grid from "@mui/material/Grid";
import Stack from "@mui/material/Stack";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Container from "@mui/material/Container";
import Link from "@mui/material/Link";
import Paper from "@mui/material/Paper";
// import Card from "react-bootstrap/Card";
// import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import { useLocation } from "react-router-dom";
import Nav from "../../../Nav";
// import { Link } from "react-router-dom";

export default function ProjectsPath() {
  // const { state } = useLocation();
  // const { name, type, desc, teamNeeded, level } = state;
  // const { type } = useParams();
  return (
    <>
    <Nav />

      <Container className="paths">
        <Row className="row">
          <Col xs={12} md={4} className="col">
            <Link to={"web"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Web Applications</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"android"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Android Applications</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"ios"} style={{ textDecoration: "none" }}>
              <div className="paths-div">IOS Applications</div>
            </Link>
          </Col>
        </Row>

        <Row>
          <Col xs={12} md={4}>
            <Link to={"ux"} style={{ textDecoration: "none" }}>
              <div className="paths-div">User Experiance</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"ui"} style={{ textDecoration: "none" }}>
              <div className="paths-div">User Interfaces</div>
            </Link>
          </Col>

          <Col xs={12} md={4}>
            <Link to={"security"} style={{ textDecoration: "none" }}>
              <div className="paths-div">Security Systems</div>
            </Link>
          </Col>
        </Row>
      </Container>
    </>
  );
}
